import axios from 'axios';
import serverUrl from '../../../../common/constants/urls';

const usersPath = '/user-information';

async function getUsersInformation(
  resultUser, setLoading, setError,
) {
  try {
    const response = await axios.get(`${serverUrl}${usersPath}`);
    const result = response.data;
    setUsers({ user: result });
    setLoading(true);
    return result;
  } catch (error) {
    return setError({ errorMessage: error.message });
  }
}

export default getUsersInformation;
